// LeaveForm.js

import React, { useState } from 'react';
import styles from './LeaveForm.module.css';

const LeaveForm = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    batch: '',
    programme: '',
    startDate: '',
    endDate: '',
    reason: '',
    medicalCertificate: false,
    emergencyCertificate: false,
  });
  const [errors, setErrors] = useState({});

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleCheckboxChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.checked,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    let newErrors = {};
    // Check for empty fields
    for (const key in formData) {
      if (formData.hasOwnProperty(key) && formData[key] === '') {
        newErrors[key] = true;
      }
    }
    if (Object.keys(newErrors).length > 0) {
      setErrors(newErrors);
      return;
    }
    // Handle form submission here
    console.log("Form submitted:", formData);
  };

  return (
    <div className={styles.leaveFormContainer}>
      <div className={styles.leaveForm}>
        <h2>Leave Request Form</h2>
        <form onSubmit={handleSubmit}>
          <div className={styles.formGroup}>
            <label htmlFor="name">Name:</label>
            <input
              type="text"
              id="name"
              name="name"
              value={formData.name}
              onChange={handleChange}
              className={errors.name ? styles.error : ''}
              required
            />
          </div>
          <div className={styles.formGroup}>
            <label htmlFor="email">Email:</label>
            <input
              type="email"
              id="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              className={errors.email ? styles.error : ''}
              required
            />
          </div>
          <div className={styles.formGroup}>
            <label htmlFor="batch">Batch:</label>
            <input
              type="text"
              id="batch"
              name="batch"
              value={formData.batch}
              onChange={handleChange}
              className={errors.batch ? styles.error : ''}
              required
            />
          </div>
          <div className={styles.formGroup}>
            <label htmlFor="programme">Programme:</label>
            <input
              type="text"
              id="programme"
              name="programme"
              value={formData.programme}
              onChange={handleChange}
              className={errors.programme ? styles.error : ''}
              required
            />
          </div>
          <div className={styles.formGroup}>
            <label htmlFor="startDate">Start Date:</label>
            <input
              type="date"
              id="startDate"
              name="startDate"
              value={formData.startDate}
              onChange={handleChange}
              className={errors.startDate ? styles.error : ''}
              required
            />
          </div>
          <div className={styles.formGroup}>
            <label htmlFor="endDate">End Date:</label>
            <input
              type="date"
              id="endDate"
              name="endDate"
              value={formData.endDate}
              onChange={handleChange}
              className={errors.endDate ? styles.error : ''}
              required
            />
          </div>
          <div className={styles.formGroup}>
            <label htmlFor="reason">Reason:</label>
            <textarea
              id="reason"
              name="reason"
              value={formData.reason}
              onChange={handleChange}
              className={errors.reason ? styles.error : ''}
              required
            ></textarea>
          </div>
          <div className={styles.formGroup}>
            <label>
              <input
                type="checkbox"
                name="medicalCertificate"
                checked={formData.medicalCertificate}
                onChange={handleCheckboxChange}
              />{' '}
              Medical Certificate
            </label>
          </div>
          <div className={styles.formGroup}>
            <label>
              <input
                type="checkbox"
                name="emergencyCertificate"
                checked={formData.emergencyCertificate}
                onChange={handleCheckboxChange}
              />{' '}
              Emergency Certificate
            </label>
          </div>
          <button type="submit">Submit</button>
        </form>
      </div>
    </div>
  );
};

export default LeaveForm;
